pub enum MemcacheRequest {
    Get {
        keys: Keys,
    },
    Gets {
        keys: Keys,
    },
    Set {
        entry: MemcacheEntry,
        noreply: bool,
    },
    Add {
        entry: MemcacheEntry,
        noreply: bool,
    },
    Replace {
        entry: MemcacheEntry,
        noreply: bool,
    },
    Append {
        entry: MemcacheEntry,
        noreply: bool,
    },
    Prepend {
        entry: MemcacheEntry,
        noreply: bool,
    },
    Delete {
        key: Key,
        noreply: bool,
    },
    Incr {
        key: Key,
        value: u64,
        noreply: bool,
    },
    Decr {
        key: Key,
        value: u64,
        noreply: bool,
    },
    Cas {
        entry: MemcacheEntry,
        noreply: bool,
    },
    FlushAll,
}

pub enum MemcacheResult {
    Deleted,
    Exists,
    Values {
        entries: Box<[MemcacheEntry]>,
        cas: bool,
    },
    NotFound,
    NotStored,
    Stored,
    Error,
    Count(u64),
}
